import React, { Component } from "react";

class ChooseRole extends Component {
  state = {};
  addRole(val) {
    console.group(val);
  }
  render() {
    return (
      <div>
        <button onClick={this.addRole} value="teacher">
          Teacher
        </button>
        <button onClick={this.addRole} value="student">
          Student
        </button>
      </div>
    );
  }
}

export default ChooseRole;
